(2, 'BUDOWA', '<!-- obrazek z anatomią -->\r\n<p>\r\n	<img class=\"czysty\" src=\"./img/anatomia.png\"/>\r\n</p>\r\n\r\n<!-- zielony blok animaci jednorazowe powiększenie -->\r\n<div id=\"animacjaTestowa1\" class=\"test-block\">kliknij, a się powiększe</div>\r\n<script>\r\n	$(\"#animacjaTestowa1\").on(\"click\", function(){\r\n		$(this).animate({\r\n			width: \"500px\",\r\n			opacity: 0.4,\r\n			fontSize: \"3em\",\r\n			borderWidth: \"10px\"\r\n		}, 1500);\r\n	});\r\n</script>\r\n	\r\n<!-- zielony blok animaci powiększanie i pomniejszanie zależnie od kursora -->\r\n<div id=\"animacjaTestowa2\" class=\"test-block\"> Najedź kursorem, a się powiększe</div>\r\n<script>\r\n	$(\"#animacjaTestowa2\").on({\r\n		\"mouseover\" : function(){\r\n			$(this).animate({\r\n			width: 300\r\n			}, 800);\r\n		},\r\n		\"mouseout\" : function() {\r\n			$(this).animate({\r\n			width: 200\r\n			}, 800);\r\n		}\r\n	});\r\n</script>\r\n	\r\n<!-- zielony blok animaci każdorazowe powiększenie i zwiększenie przezroczystości -->	\r\n<div id=\"animacjaTestowa3\" class=\"test-block\"> Kliknij, abym urósł</div>\r\n<script>\r\n	$(\"#animacjaTestowa3\").on(\"click\", function(){\r\n		if(!$(this).is(\":animated\")) {\r\n			$(this).animate({\r\n				width: \"+=\" + 50,\r\n				height: \"+=\" + 10,\r\n				opacity: \"-=\" + 0.1,\r\n				duraction : 3000\r\n			});\r\n		}\r\n	});\r\n</script>		', 0),
(3, 'WYSTĘPOWANIE', '<!-- mapa z przyciskami -->\r\n<div class=\"container\">\r\n	<!-- mapa -->\r\n	<img src=\"./img/mapa.png\" style=\"width:100%; border: none; margin: 0px;\">\r\n	<!-- przyciski -->\r\n	<a href=\"./index.php?idp=Indie\"> <button class=\"mappin\" style=\'left:69%; top:38%\'></button> </a> \r\n	<a href=\"./index.php?idp=Wietnam\"> <button class=\"mappin\" style=\'left:77%; top:40%\'></button> </a> \r\n	<a href=\"./index.php?idp=Filipiny\"> <button class=\"mappin\" style=\'left:81%; top:42%\'></button> </a> \r\n	<a href=\"./index.php?idp=Australia\"> <button class=\"mappin\" style=\'left:86%; top:57%\'></button> </a> \r\n	<a href=\"./index.php?idp=Papua-Nowa-Gwinea\"> <button class=\"mappin\" style=\'left:88%; top:50%\'></button> </a>\r\n	<a href=\"./index.php?idp=Malezja\"> <button class=\"mappin\" style=\'left:78%; top:48%\'></button> </a>\r\n</div>\r\n', 1),
