(6, 'Australia', '<!-- nagłowek -->\r\n<h4 style=\'text-align: center;\'>\r\n	Straszyk australijski (Extatosoma tiaratum)\r\n</h4>\r\n\r\n<!-- treść: tekst i obrazki -->\r\n<p>\r\n	Duży gatunek straszyka. Samice osiągają 12-115cm, samce około 8-10cm. Osobniki dostępne \r\n	w hodowlach hobbystycznych, w środowisku naturalnym, zamieszkują głównie rejony północnego \r\n	stanu Australii o nazwie Queensland.\r\n	\r\n	<img class=\"doprawo\" src=\"./img/P.Aus.2.png\" style=\"width:40%;\">	\r\n	\r\n	Na pierwszy rzut oka wyglądem przypominają trochę skorpiony, \r\n	gdyż ich część ogonowa, często jest zawinięta do góry. Kolorem, który dominuje w jego wyglądzie \r\n	są różne odcienie brązowego. Samice dożywają maksymalnie 18 miesięcy, samce rzadko kiedy  12.\r\n	\r\n	<img class=\"dolewo\" src=\"./img/P.Aus.1.png\" style=\"width:20%;\">\r\n	\r\n	<img class=\"dolewo\" src=\"./img/P.Aus.3.png\" style=\"width:10%;\">\r\n	\r\n	Duży gatunek straszyka. Samice osiągają 12-15cm, samce około 8-10cm. Osobniki dostępne \r\n	w hodowlach hobbystycznych, w środowisku naturalnym, zamieszkują głównie rejony północnego \r\n	stanu Australii o nazwie Queensland. Na pierwszy rzut oka wyglądem przypominają trochę skorpiony, \r\n	gdyż ich część ogonowa, często jest zawinięta do góry. Kolorem, który dominuje w jego wyglądzie \r\n	są różne odcienie brązowego. Samice dożywają maksymalnie 18 miesięcy, samce rzadko kiedy  12.\r\n</p>\r\n	\r\n<br><br><br>', 1),
(7, 'Filipiny', '<!-- nagłówek -->\r\n<h4 style=\'text-align: center;\'>\r\n	Straszyk filipiński (Sungaya inexpectata)\r\n</h4>\r\n\r\n<!--  treść i obrazki -->\r\n<p>\r\n	<img class=\"dolewo\" src=\"./img/P.Fil.2.png\" style=\"width:20%;\">\r\n	\r\n	<img class=\"dolewo\" src=\"./img/P.Fil.3.png\" style=\"width:20%;\">\r\n	\r\n	<img class=\"dolewo\" src=\"./img/P.Fil.1.png\" style=\"width:20%;\">\r\n	\r\n	Prosty i popularny gatunek, zamieszkujący tereny Filipin. Występuje w kilku odmianach barwnych. \r\n	Zielono żółtej, czarno brązowej i brązowo białej. W zależności od warunków, może zmieniać swój kolor.\r\n	Jest małym gatunkiem, samice osiągają maksymalnie 8cm, a samce 5-6cm. Żyje średnio 10-14 miesięcy. \r\n	Samce żyją o kilka miesięcy krócej. W odróżnieniu od patyczaków, straszyki wyglądają jak dużo \r\n	grubsze gałązki drzew. Samice żyją kilkanaście miesięcy, samce najczęściej nie dożywają roku.\r\n	Prosty i popularny gatunek, zamieszkujący tereny Filipin. Występuje w kilku odmianach barwnych. \r\n	Zielono żółtej, czarno brązowej i brązowo białej. W zależności od warunków, może zmieniać swój kolor.\r\n	Jest małym gatunkiem, samice osiągają maksymalnie 8cm, a samce 5-6cm. Żyje średnio 10-14 miesięcy. \r\n	Samce żyją o kilka miesięcy krócej. W odróżnieniu od patyczaków, straszyki wyglądają jak dużo \r\n	grubsze gałązki drzew. Samice żyją kilkanaście miesięcy, samce najczęściej nie dożywają roku.Prosty i \r\n	popularny gatunek, zamieszkujący tereny Filipin. Występuje w kilku odmianach barwnych. \r\n	Zielono żółtej, czarno brązowej i brązowo białej. W zależności od warunków, może zmieniać swój kolor.\r\n	Jest małym gatunkiem, samice osiągają maksymalnie 8cm, a samce 5-6cm. Żyje średnio 10-14 miesięcy. \r\n	Samce żyją o kilka miesięcy krócej. W odróżnieniu od patyczaków, straszyki wyglądają jak dużo \r\n	grubsze gałązki drzew. Samice żyją kilkanaście miesięcy, samce najczęściej nie dożywają roku.\r\n</p>\r\n	\r\n<br><br><br>', 1),
