(9, 'Malezja', '<!-- nagłówek 1 -->\r\n<h4 style=\'text-align: center;\'>\r\n	Liściec jesienny (Phyllium philippinicum)\r\n</h4>\r\n\r\n<!-- blok 1: treść i obrazki -->\r\n<p>\r\n	Bardzo ładny liścciec pochodzący z Malezji sklasyfikowany przez Linnaeusa w 1754. \r\n	Samica wyraźnie różni się od samca, wielkości od 8,5 do 9,5 cm, posiada szerokie skrzydła na \r\n	których występują przebarwienia. Składa około 200 jaj, ciekawostką jest to, że jajka składane \r\n	są tylko w nocy a efekt jak taki jak ktoś by strzelał z czegoś do terrarium. Jajka nabierają \r\n	dopiero wyglądu jajek ze zdjęcia kiedy wchłoną odpowiednia ilość wody. Samice żyją około 6-8 \r\n	przy zapewnieniu im odpowiednich warunków. Samiec jest mniejszy do samicy 6,5-7 cm.\r\n	Potrafi latać, żyje krótko, 4-6 miesięcy. <br>\r\n	\r\n	<img src=\"./img/L.Mal.1.png\" style=\"height:200px;\">\r\n	<img src=\"./img/L.Mal.2.png\" style=\"height:200px;\">\r\n	<img src=\"./img/L.Mal.3.png\" style=\"height:200px;\">\r\n</p>\r\n\r\n<!-- nagłówek 2 -->	\r\n<h4 style=\'text-align: center;\'>\r\n	Liściec dwuoki (Phyllium bioculatum)\r\n</h4>\r\n\r\n<!-- blok 2: treść i obrazki -->\r\n<p>\r\n	Liściec dwuoki występuje w naturze na Jawie, w Malezji i na Sri Lance.\r\n	Polska nazwa liściec dwuoki pochodzi od dwóch okrągłych plam na odwłoku imitujących oczy. \r\n	Tą taktykę stosuje wiele innych gatunków liśćców. Samica (dorasta do 8,5 cm długości ciała):\r\n	ma szerokie, grzbietobrzusznie spłaszczone ciało, o dość regularnym kształcie imitującym liść. \r\n	Samice posiadają szerokie przednie odnóża i nieco mniejszą od pozostałych gatunków pierwszą parę \r\n	zgrubiałych i użyłkowanych skrzydeł. Druga para skrzydeł jest zredukowana do przezmianek. Samica \r\n	jest masywna, niezdolna do lotu, posiada krótkie do 0,5cm czułka. Samiec (dorasta do 6 cm długości ciała): \r\n	ma szerokie odnóża, jest smukły, a jego odwłok przypomina kształtem łyżeczkę. Samce mają dobrze rozwiniętą drugą \r\n	parę skrzydeł, potrafią aktywnie latać na niewielkim dystansie. Pierwsza para skrzydeł jest zredukowana i zgrubiała. <br>\r\n	\r\n	<img src=\"./img/L.JMS.1.png\" style=\"height:200px;\">\r\n	\r\n	<img src=\"./img/L.JMS.2.png\" style=\"height:200px;\">\r\n	\r\n	<img src=\"./img/L.JMS.3.png\" style=\"height:200px;\">\r\n</p>\r\n	\r\n<!-- nagłówek 3 -->	\r\n<h4 style=\'text-align: center;\'>\r\n	Liściec olbrzymi (Phyllium giganteum)\r\n</h4>\r\n\r\n<!-- blok 3: treść i obrazki -->\r\n<p>\r\n	Występuje na Półwysepie Malajskim, a zwłaszcza Wyżynie Cameron oraz okolicznych wyspach. \r\n	Jest to jeden z większych gatunków, osiąga do 12 cm długości. Ciało jest silnie spłaszczone grzbieto-brzusznie; \r\n	owad jest cienki niczym kartka papieru, jedynie dorosła samica składająca jaja ma nieco pogrubiony odwłok. \r\n	Kształtem przypomina liść, a na pokrywach skrzydeł posiada żyłkowanie. Barwa najczęściej zielona, zdarzają się \r\n	jednak zarówno osobniki brązowawe, jak i żółte – wszystko zależy w jakim otoczeniu przebywa owad. Cały usiany jest \r\n	brązowymi kropkami. Brzegi jego ciała są nieco nierównomierne, co imituje lekko nadgryziony liść. <br>\r\n	\r\n	<img src=\"./img/L.MWC.1.png\" style=\"height:200px;\">\r\n	\r\n	<img src=\"./img/L.MWC.2.png\" style=\"height:200px;\">\r\n	\r\n	<img src=\"./img/L.MWC.3.png\" style=\"height:200px;\">\r\n</p>\r\n	\r\n<br><br><br>', 1),
(10, 'Papua-Nowa-Gwinea', '<!-- nagłowek -->\r\n<h4 style=\'text-align: center;\'>\r\n	Straszyk nowogwinejski (Eurycantha calcarata)\r\n</h4>\r\n\r\n<!-- trześć i obrazki -->\r\n<p>\r\n	<img class=\"dolewo\"src=\"./img/P.PNG.1.png\" style=\"width:20%;\">\r\n	\r\n	Jeden z największych straszyków. Oprócz sporej długości, charakteryzuje się również dość masywnym \r\n	jak na owada ciałem . Samice osiągają 15-16cm, samce 10-14cm. Występuje głównie w kolorze czarnym. \r\n	W naturze zamieszkuje tereny Papui – Nowej Gwinei. Zaniepokojone samce,  bronią się zaciskając \r\n	tylne odnóża na których znajdują się wypustki, przypominające trochę wyglądem kolce róży czy akacji. \r\n	Samice dożywają maksymalnie 18 miesięcy, samce rzadko kiedy  12. \r\n	Jeden z największych straszyków. Oprócz sporej długości, charakteryzuje się również dość masywnym \r\n	jak na owada ciałem . Samice osiągają 15-16cm, samce 10-14cm. Występuje głównie w kolorze czarnym. \r\n	W naturze zamieszkuje tereny Papui – Nowej Gwinei. Zaniepokojone samce,  bronią się zaciskając \r\n	tylne odnóża na których znajdują się wypustki, przypominające trochę wyglądem kolce róży czy akacji. \r\n	Samice dożywają maksymalnie 18 miesięcy, samce rzadko kiedy  12.\r\n	Jeden z największych straszyków. Oprócz sporej długości, charakteryzuje się również dość masywnym \r\n	jak na owada ciałem . Samice osiągają 15-16cm, samce 10-14cm. Występuje głównie w kolorze czarnym. \r\n	W naturze zamieszkuje tereny Papui – Nowej Gwinei. Zaniepokojone samce,  bronią się zaciskając \r\n	tylne odnóża na których znajdują się wypustki, przypominające trochę wyglądem kolce róży czy akacji. \r\n	Samice dożywają maksymalnie 18 miesięcy, samce rzadko kiedy  12.\r\n	Jeden z największych straszyków. Oprócz sporej długości, charakteryzuje się również dość masywnym \r\n	jak na owada ciałem . Samice osiągają 15-16cm, samce 10-14cm. Występuje głównie w kolorze czarnym. \r\n	W naturze zamieszkuje tereny Papui – Nowej Gwinei. Zaniepokojone samce,  bronią się zaciskając \r\n	tylne odnóża na których znajdują się wypustki, przypominające trochę wyglądem kolce róży czy akacji. \r\n	Samice dożywają maksymalnie 18 miesięcy, samce rzadko kiedy  12.\r\n	Jeden z największych straszyków. Oprócz sporej długości, charakteryzuje się również dość masywnym \r\n	jak na owada ciałem . Samice osiągają 15-16cm, samce 10-14cm. Występuje głównie w kolorze czarnym. \r\n	W naturze zamieszkuje tereny Papui – Nowej Gwinei. Zaniepokojone samce,  bronią się zaciskając \r\n	tylne odnóża na których znajdują się wypustki, przypominające trochę wyglądem kolce róży czy akacji. \r\n	Samice dożywają maksymalnie 18 miesięcy, samce rzadko kiedy  12.\r\n	Jeden z największych straszyków. Oprócz sporej długości, charakteryzuje się również dość masywnym \r\n	jak na owada ciałem . Samice osiągają \r\n	\r\n	<img class=\"dolewo\"src=\"./img/P.PNG.2.png\" style=\"width:40%;\">\r\n	\r\n	<img class=\"doprawo\"src=\"./img/P.PNG.3.png\" style=\"width:20%;\"> \r\n	\r\n	15-16cm, samce 10-14cm. Występuje głównie w kolorze czarnym. \r\n	W naturze zamieszkuje tereny Papui – Nowej Gwinei. Zaniepokojone samce,  bronią się zaciskając \r\n	tylne odnóża na których znajdują się wypustki, przypominające trochę wyglądem kolce róży czy akacji. \r\n	Samice dożywają maksymalnie 18 miesięcy, samce rzadko kiedy  12.\r\n	Jeden z największych straszyków. Oprócz sporej długości, charakteryzuje się również dość masywnym \r\n	jak na owada ciałem . Samice osiągają 15-16cm, samce 10-14cm. Występuje głównie w kolorze czarnym. \r\n	W naturze zamieszkuje tereny Papui – Nowej Gwinei.\r\n</p>\r\n\r\n<br><br><br>', 1),
(11, 'Wietnam', '<!-- nagłówek 1 -->\r\n<h4 style=\'text-align: center;\'>\r\n	Patyczak wietnamski (Ramulus artemis)\r\n</h4>\r\n\r\n<!-- blok 1: treść i obrazki -->\r\n<p>\r\n	<img class=\"dolewo\" src=\"./img/P.Wie.1.png\" style=\"height:200px;\">\r\n	\r\n	<img class=\"dolewo\" src=\"./img/P.Wie.2.png\" style=\"height:200px;\">\r\n	\r\n	<img class=\"dolewo\" src=\"./img/P.Wie.3.png\" style=\"height:200px;\">\r\n	\r\n	Jego domem jest Wietnam. Jest gatunkiem większym od poprzednika osiągającym nawet 12cm. \r\n	Wszystkie dostępne osobniki są samicami i rozmnażają się poprzez partenogenezę (bez udziału samców). \r\n	Występuje w kolorach zbliżonych do zielonego i brązowego. Żyje do 12 miesięcy.\r\n	Jego domem jest Wietnam. Jest gatunkiem większym od poprzednika osiągającym nawet 12cm. \r\n	Wszystkie dostępne osobniki są samicami i rozmnażają się poprzez partenogenezę (bez udziału samców). \r\n	Występuje w kolorach zbliżonych do zielonego i brązowego. Żyje do 12 miesięcy.\r\n	Jego domem jest Wietnam. Jest gatunkiem większym od poprzednika osiągającym nawet 12cm. \r\n	Wszystkie dostępne osobniki są samicami i rozmnażają się poprzez partenogenezę (bez udziału samców). \r\n	Występuje w kolorach zbliżonych do zielonego i brązowego. Żyje do 12 miesięcy.\r\n</p>\r\n	\r\n<!-- nagłówek 2 -->\r\n<h4 style=\'text-align: center;\'>\r\n	Patyczak rogaty (Medauroidea extradentata)\r\n</h4>\r\n\r\n<!-- blok 2: treść i obrazki -->\r\n<p>\r\n	<img class=\"doprawo\" src=\"./img/P.Rog.1.png\" style=\"height:200px;\">\r\n	\r\n	<img class=\"doprawo\" src=\"./img/P.Rog.2.png\" style=\"height:200px;\">\r\n	\r\n	<img class=\"doprawo\" src=\"./img/P.Rog.3.png\" style=\"height:200px;\">\r\n	\r\n	Spośród wszystkich dostępnych gatunków, ten jest najbardziej popularny i najłatwiejszy w hodowli. \r\n	Jego nazwa wywodzi się od 2 małych wypustek na głowie, które trochę przypominają rogi. \r\n	Samice osiągają 9-10cm, samce 6-7cm. Występuje głównie w kolorze brązowo-oliwkowym. \r\n	W środowisku naturalnym, głównie możemy go spotkać, na tych samych terenach, \r\n	na których żyje jego wietnamski kolega. Żyje maksymalnie kilkanaście miesięcy.\r\n	Spośród wszystkich dostępnych gatunków, ten jest najbardziej popularny i najłatwiejszy w hodowli. \r\n	Jego nazwa wywodzi się od 2 małych wypustek na głowie, które trochę przypominają rogi. \r\n	Samice osiągają 9-10cm, samce 6-7cm. Występuje głównie w kolorze brązowo-oliwkowym. \r\n	W środowisku naturalnym, głównie możemy go spotkać, na tych samych terenach, \r\n	na których żyje jego wietnamski kolega. Żyje maksymalnie kilkanaście miesięcy.\r\n	Spośród wszystkich dostępnych gatunków, ten jest najbardziej popularny i najłatwiejszy w hodowli. \r\n	Jego nazwa wywodzi się od 2 małych wypustek na głowie, które trochę przypominają rogi. \r\n	Samice osiągają 9-10cm, samce 6-7cm. Występuje głównie w kolorze brązowo-oliwkowym. \r\n	W środowisku naturalnym, głównie możemy go spotkać, na tych samych terenach, \r\n	na których żyje jego wietnamski kolega. Żyje maksymalnie kilkanaście miesięcy.\r\n</p>\r\n	\r\n<br><br><br>', 1);

